data.value:
Wird für automatisches Speichern von Wiederholungen nach Rennen benutzt

Werte zum Ersetzen:
 [b][mono]{type}[/mono][/b] — Rennart;
 [b][mono]{car}[/mono][/b] — Fahrzeugname;
 [b][mono]{car.id}[/mono][/b] — Fahreug ID;
 [b][mono]{track}[/mono][/b] — Streckenname;
 [b][mono]{track.id}[/mono][/b] — Strecken ID;
 [b][mono]{date}[/mono][/b] — Datum und Zeit in korrektem Formatt;
 [b][mono]{date_ac}[/mono][/b] — Datum und Zeit in AC Format.

Modifikatoren:
 [b][mono]{…:l}[/mono][/b] — Kleinbuchstaben;
 [b][mono]{…:u}[/mono][/b] — Großbuchstaben;
 [b][mono]{…:0}[/mono][/b] — Nur das erste Zeichen.

Beispiele:
 [b][mono]{car.id}_{track.id}_{date_ac}[/mono][/b] — Standard Kunos Format
 [b][mono]({type:l0}) {car:l} on {track:l}.acreplay[/mono][/b] — z.B.: “[w] bmw m3 e30 on brands hatch.acreplay”

Wenn andere Werte benötigt werden, bitte kontaktiere uns und wir werden sie hinzufügen.

[b]Warnung[/b]:
 Bitte keine Zeichen wie z.B. “[” or “]”! verwenden

