data.value:
Dieser Befehl wird ausgeführt nachdem acs.exe gestartet, jedoch bevor INI-Dateien geschrieben werden.

Parameter zu ersetzen:
 [b][mono]{type}[/mono][/b] — Typ des Rennens;
 [b][mono]{car}[/mono][/b] — Fahrzeugname;
 [b][mono]{car.id}[/mono][/b] — Fahrzeug-ID;
 [b][mono]{track}[/mono][/b] — Streckenname;
 [b][mono]{track.id}[/mono][/b] — Strecken-ID.

Sollten mehr Parameter benötigt werden bitte kontaktiere uns und wir werden sie hinzufügen.

Der Assetto Corsa-Ordner im Dokumentenverzeichnis wird als Arbeitsverzeichnis festgelegt.

Dieser Befehl wird ausgeführt nachdem acs.exe schließt, jedoch bevor das JSON-Dateien für das Ergebnis gelesen werden.

Parameter zu ersetzen:
 [b][mono]{type}[/mono][/b] — Typ des Rennens;
 [b][mono]{car}[/mono][/b] — Fahrzeugname;
 [b][mono]{car.id}[/mono][/b] — Fahrzeug-ID;
 [b][mono]{track}[/mono][/b] — Streckenname;
 [b][mono]{track.id}[/mono][/b] — Strecken-ID.

Sollten mehr Parameter benötigt werden bitte kontaktiere uns und wir werden sie hinzufügen.

Der Assetto Corsa-Ordner im Dokumentenverzeichnis wird als Arbeitsverzeichnis festgelegt.

Reguliert Einfluss anderer Farben auf die Wolken:
 • [b]0%:[/b] nur Farb-Effekte auf die Wolken werden berücksichtigt;
 • [b]50%:[/b] 50% Wolkenfarben, 50% Farb-Effekte;
 • [b]100%:[/b] nur Wolkenfarben werden berücksichtigt
